def can_construct(ransom_note, magazine)
  ransom_note_words = ransom_note.split('').group_by {|c| c}
  magazine_words = magazine.split('').group_by {|c| c}
  ransom_note_words.each do |k, v|
    return false if magazine_words[k].nil? || magazine_words[k].size < v.size
  end
  true
end

p can_construct 'a', 'b'
